import React, { Component } from 'react';
import '../index.css';
import Text from '../components/mainText';
import Dropdown from '../components/dropdown';

class FieldSetting extends React.Component {
  constructor() {
    super();
  }

  render() {
    const time = [30, 45, 90];
    const fieldSize = ['small', 'normal', 'large'];
    const yeild = ['Mongolian Steppe', 'European Average', 'Belorusian Magic'];
    return (
      <div className="section">
        <form className="raw">
          <label classprop="main-text" label="Time:" />
          <Dropdown data={time} />
        </form>
        <div className="raw">
          <Text classprop="main-text" label="Field size:" />
          <Dropdown data={fieldSize} />
        </div>
        <div className="raw">
          <Text classprop="main-text" label="Yeild:" />
          <Dropdown data={yeild} />
        </div>
      </div>
    );
  }
}
export default FieldSetting;
